import React from "react";

function LookupResultField(props) {



    return (
        <div>
            <div className="lookup-result">
                <p>{props.name}</p>
                <p>{props.license}</p>
                <p>{props.vehicle}</p>
                <p>{props.plan}</p>
                <p>{props.phone}</p>
                <p>{props.email}</p>
            </div>
        </div>
    )
}

export default LookupResultField;
